import React from "react";
import LongCard from "../Components/LongCard";

const Education = () => {
  return (
    <div className="h-screen bg-gradient-to-br from-green-500 to-blue-300">
      <div className="home grid grid-cols-2 gap-4 w-[80%] ml-52 pt-20 bg-slate-500">
        <LongCard>{(title = "This is title")}</LongCard>
      </div>
    </div>
  );
};

export default Education;
